package tutorials.jenkov.com.java.math;

public class Subtration2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int result = 200;
		result = result - 10;
		System.out.println("Result : " + result);
		int result1 = 200;
		result1 -= 10;
		System.out.println("Result1 : " + result1);

	}

}
